import React, { Component } from "react";
import MusicItem from "./musicItem";


class MusicMain extends Component {
   
    render() {
        let item = this.props.item;
        return (
            <div>
                {this.state._ar.map(item =>{
                        return(
                            <MusicItem item ={item} key={item.id}/>
                        )
                    })}
            </div>

        )
    }
}

export default MusicMain;
